  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains description of vegetation
  and organic and mineral soil of the Okefenokee Swamp. This report covers the investigations
  made on a tract of the swamp lying on both sides of the Suwannee Canal on the eastern
  edge southwest of Folkston. This area consists of a rectangular tract of approximately
  12,000 acres, it being about 3 miles wide from the edge of the swamp and about 6
  miles long. The soil was examined over this whole tract, its depth determined at
  the corners of each 40-acre square, and other items of interest noted. Samples were
  secured at various points to represent variations in the character of the soil material
  and its state of decay.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
